------------------------------------------------------------------------------------
--
-- This script updates tlbOutbreak EIDSS6 records to the new EIDSS7 idfsOutbreakStatus
-- values.
--
------------------------------------------------------------------------------------
-- Create Temp table for processing
DROP TABLE IF EXISTS dbo.ZZZ_OutbreakStatus
GO
PRINT N'Creating [dbo].[ZZZ_OutbreakStatus]'
GO

CREATE TABLE dbo.ZZZ_OutbreakStatus
(
	idfOutbreak BIGINT,
	E6_idfsOutbreakStatus BIGINT,
	idfsOutbreakStatus BIGINT,
	E6_strOutbreak NVARCHAR(100),
	E7_strOutbreak NVARCHAR(100),
	datFinishDate DATE

)

PRINT(N'Add 1618 rows to [dbo].[ZZZ_OutbreakStatus]')


-- Update migrated E6 records from tlbOutbreak in the EIDSS7 database 
UPDATE T
SET T.idfsOutbreakStatus = S.idfsOutBreakStatus
FROM dbo.tlbOutbreak T
INNER JOIN dbo.ZZZ_OutbreakStatus S ON S.idfOutbreak = T.idfOutbreak
WHERE T.SourceSystemNameID = 10519002 -- source system is E6


